Man I’ve wrote and erased my words so many times cause I’ve been trying to say the perfect thing but sometimes you just have to say it 

First off i’m extremely grateful to the 276 people who prepaid for the “Day One” sneakers without even seeing them. Humbled. 

I didn’t wanna make a shoe without a community element attached to it so the first 400 pairs purchased will come with a QR code that will allow the purchaser to gift his “Day One” a pair of sneakers .

Me and my brother @mbroidered started this journey over a year ago and went thru so many designs and colorways so many name changes and name designs. We even went thru packaging details over and over to finally get to this point. @danieljcherry you have an insane designer and an even better person on your team.

