What an amazing 48 hours!!! The kickoff to the #dayone sneaker release started with @j.a.y.academy and adidas cornerstone having the honor of hosting over 100 students from across 52 club sites at the Daniels and mardak boys and girls club. 
They got to design and DIY their own socks,hats, shirts and shoes !!! 
We have to always push forward and keep inspiring and motivating the youth and giving them the confidence and support they need. that’s how you build trust and that’s how you build community !!! Thank you to adidas cornerstone team who went above and beyond to make sure I could take the weekend off and just enjoy the festivities!!! 
